import React from 'react'

function Cookie() {
    return (
        <div>
            Manak Waste Management Private Limited (Cashify) uses cookies<br/>
at https://www.cashify.in (the Website) to distinguish you from other users of this Website. This helps us to provide you with a good <br/>experience when you browse our Website and also allows us to improve our Website. By using this Website, you consent to our use of cookies in accordance with this Cookie Notice. You will have seen a pop up to this effect on your first visit to the Website. Although it will not usually appear on subsequent visits, you may withdraw your consent at any time by following the instructions below, including by changing your browser settings so that cookies from this Website cannot be placed on your device. Please note that some of the services on the Website will not function so well if cookies are disabled. After your initial visit to the Website we may change the cookies we use. This cookies policy will always allow you to know who is placing cookies, for what purpose and give you the means to disable them so you should check it from time to time.
        </div>
    )
}

export default Cookie
